import React,{useContext, useEffect} from "react";
import {Context as AuthContext} from "../context/AuthContext"

const NoScreen = () => {

    const {tryLocalSingin} = useContext(AuthContext);

    useEffect(() => {
        tryLocalSingin()    
    },[])
    return null;
}

export default NoScreen;
